window.bookSummaryJSON = "<p>I’ve waited 1000 years for my mate. If she rejects me, I’ll burn down the world.</p> <p>She woke the dragon.</p> <p>Every maiden dreams of being rescued by a handsome prince from a deadly dragon. But I am the prince and the dragon.</p> <p>Ancient courtship rituals demand I steal my bride away. Imprison her in my high tower. Show her my treasures, vast lands, and armies.</p> <p>I’ve done all that, and she still refuses me. She says she can’t see herself with a man who still thinks Istanbul is Constantinople.</p> <p>I must woo her, and I don’t know how. But beneath my beating human heart, a dragon sleeps. And when he wakes, no one can stop him from destroying the world.</p> <p>No one but her.</p>"; 
